export default function Todoinput() {

    function addTodo () {
        document.getElementById('test').innerText = document.getElementById('todo').value;
    }

    return (
        <div className="appToDo">
        <h1>Add list to do you will do in the day</h1>
        <input id="todo" type="text" defaultValue="test"/>
        <button type="submit" onClick={addTodo}>Add To do</button>

        <li>
                <div id='test'></div>
        </li>
        <button type="button">Done</button>
        <button type="button">Delete</button>
        </div>
    )
}
